import React from 'react';
import SQLHeroLogo from '../../assets/images/SQL Hero Logo.png';
import Home from '../../assets/images/home.svg';
import Challenges from '../../assets/images/challenges.svg';
import Community from '../../assets/images/community.svg';
import Settings from '../../assets/images/settings.svg';

function MainNav() {
    return (
        <nav className='h-full'>
            <ul className='flex flex-col w-60 ps-10 border-r py-10 gap-10'>
                <li>
                    <a href=''><img src={SQLHeroLogo} alt='SQL Hero Logo' className='h-10' /></a>
                </li>
                <li>
                    <a href=''><img src={Home} alt='Home' className='w-8 inline-block align-middle' />Home</a>
                </li>
                <li>
                    <a href=''><img src={Challenges} alt='Challenges' className='w-8' />Challenges</a>
                </li>
                <li>
                    <a href=''><img src={Community} alt='Community' className='w-8' />Community</a>
                </li>
                <li>
                    <a href=''><img src={Settings} alt='Settings' className='w-8' />Settings</a>
                </li>
            </ul>
        </nav>
    );  
}

export default MainNav;
